exports.step = function (input) {
  return {
    q:
      `SELECT s.id, s.name, a.city, case when a.country in ('CN','JP') 
																			then coalesce(st.fullname,a.state) else a.state 
																		end as state, c.name as country, a.addr1, a.addr2, a.zip, 
							cr.symbol as currency, s.isinactive, s.iselimination
				FROM Subsidiary s
        LEFT JOIN subsidiaryMainAddress a on a.nkey = s.mainaddress
        LEFT JOIN country c on c.id = a.country
        LEFT JOIN state st on st.shortname = a.state and st.country = a.country
        LEFT JOIN currency cr on cr.id = s.currency
        where s.id = ` + input.subsidiaryId
  };
};

exports.step = function(input) {
  if (!input.link) {
    return undefined;
  }
	const regex = /^https:\/\/.+force\.com\/servlet\/servlet\.ImageServer((\?id=(?<id>[^&]+)&)|(\?.+&id=(?<id2>[^&]+)&?))(.+)?$/;
	const documentId = input.link.match(regex)?.groups?.id || input.link.match(regex)?.groups?.id2;
  return documentId;
};

// if the file doesn't have extension, we need to add to upload to SF
exports.step = function(input) {
	if (input.fileType === '_PNGIMAGE' && input.name.substr(input.name.length -4).toLowerCase() !== '.png') {
    return `${input.name}.png`;
  } else if (input.fileType === '_JPGIMAGE' && input.name.substr(input.name.length -4).toLowerCase() !== '.jpg') {
    return `${input.name}.jpg`;
  }
  return input.name;
};

exports.step = function(input) {
  if (!input.addr1 && !input.addr2) {
    return null;
  }
  if (input.addr1 && input.addr2) {
		return `${input.addr1}\n${input.addr2}`;
  }
  if (input.addr1) {
  	return `${input.addr1}`;
  }
  return `${input.addr2}`;
};
